import React from "react";

const MovieCast = ({ selectedMovie }) => {
  const renderActors = () => {
    return selectedMovie.actors.map((actor) => {
      return (
        <div className="cast-card">
          <img src={actor.starImageURL} alt="star image" />
          <div className="star-details">
            <h5 className="star-name">{actor.starName}</h5>
            <h6 className="role">{actor.role}</h6>
          </div>
        </div>
      );
    });
  };
  return (
    <div className="card-container">
      <div className="inner-container">
        <div className="cast">
          <div className="cast-title">Cast</div>
          {renderActors()}
          <div className="clear"></div>
        </div>
      </div>
    </div>
  );
};

export default MovieCast;
